parameters.query:
select
  coalesce((
    select count(*)
    from cor_associado
    where id_pessoa = {{ $('buscaPessoa').item.json.id_pessoa}}
  ), 0) as total,
  (select {{ $('buscaPessoa').item.json.id_pessoa}}) as id_pessoa;

fieldValues.fieldValue:
={{
  (()=>{
    const valor = $('Loop Over Items1').item.json.associados?.data_cadastro_associado;
    if (!valor) return null; // Caso seja vazio, null, undefined
    try {
      return new Date(valor).toISOString(); // ou $moment(valor).format('DD/MM/YYYY')
    } catch (e) {
      return null; // Retorna null se falhar
    }
  })()
}}

